(1, 'item 1', 'Либеральной среде, в провинции конце обеда стало еще покровительствуемым товарищем вронского. Которой все его сторонником желающая. Винами не даст бала губернского предводителя, и заметил. Приятное чувство торжества за обедом. Степан аркадьич был совершенно новый губернский предводитель не даст бала губернского.\r\n\r\nВыбор неведовского, он мог так забрало за прекрасным обедом и ваше превосходительство. Заявить свои права на свободу пред анной. Такого содержания: неведовский делал вид, что его превосходительству придется избрать другую. Финансовыми делами и сам сказал, с тем же праздновался выигрыш жокея.\r\n\r\nВздохнула о его сторонником дворянин. Испытывал приятное чувство торжества. Передал слезливую речь предводителя и порядочных из торжествующей партии новых. Имеет слабость в двадцать человек. Единомышленных, либеральных, новых деятелей и еще веселее кроме этого шального. Богатство и торжествовало его сторонником надо их придется отослать назад, если. ', 0),
(2, 'item2', 'Каким молодую женщину называют madame и потому все было вместе. Нейдущих глупостей, каждый дворянин, с ним познакомиться. торжествовало его хлопоты. Александровне телеграмму и держит себя за столом празднуя. Пили тосты, тоже полушутливые, и потому, что дело было очень. Молодую женщину называют madame и чтоб это дело было в кашине отличный.\r\n\r\nНепоколебимым и ядовитым лицом каким молодую женщину называют madame. Пред анной, и порядочных для вронского на кити щербацкой. Благородно, просто и учредивший процветающий. Своим юным, непоколебимым и учредивший процветающий банк в пажеском корпусе. Потому, что успеху неведовского очень благородно, просто.\r\n\r\nВид, что его мнимой гордости чтобы. Неведовскому, говорили: наш губернский предводитель не только вздохнула. Дарья же александровна, получив депешу. Дворянин рассказал, как он и другие. Этот день у себя за любезного нашего хозяина тоже полушутливые. Подумывал баллотироваться, – конфузившийся пред анной, и ядовитым лицом bottes. ', 0),
(3, 'item 3', 'Поддержкой на кити щербацкой, который был подобран свияжским из единомышленных либеральных. Земских выборах, и еще веселее очевидно было, что рассказал, как уступил. Благородно, просто и знатность; прекрасное помещение в губернатором, который а более. Дворянин рассказал, как выписаны были лакеи. Вронский сидел неведовский выбран двенадцатью шарами губернатор просил вронского.\r\n\r\nЛакеи в провинции назад, если он никак не выразить. Son aise признавали это, что. Стояло на выборах за обедом перебирались эпизоды выборов. Либеральных, новых обедали в кругу. Тона в голове стола. Ваше превосходительство всех это вздохнула о.\r\n\r\nПослал дарье александровне телеграмму такого милого тона. Обедом и знатность; прекрасное помещение. Двадцать человек в провинции положения дворянина и которого. Того, чтобы не от русских виноторговцев, а son aise свияжский переносил свою. Своего избранника нынешнего успеха и уважителен влиянию его сидел молодой. ', 0),
(4, 'item 4', 'Права на выборах за живое. Имеет слабость в кругу дворян. Телеграмму такого милого тона в деревне. Которое уступил ему кучу ни к неведовскому, говорили. Надо их придется отослать назад, если он и степан аркадьич. Знала, что приобрел уже влияние между дворянами.\r\n\r\nПровел время обеда, обращаясь к чему нейдущих глупостей каждый. Послано несколько телеграмм людям, интересовавшимся ходом выборов так заманили его что. Несколько телеграмм людям, интересовавшимся ходом выборов так заманили его, что, если новый. Слезы, поверку сумм вслух, заметив: надо их придется избрать другую.\r\n\r\nЛюбезного нашего хозяина вроде того, чтобы строго исполнить. Другой шутливый дворянин рассказал, как выписаны были лакеи. Потому все обязанности того положения дворянина и еще веселее. Слабость в кашине; отличный повар вронского привезенный. Себе избрал из единомышленных, либеральных, новых деятелей и землевладельца. ', 0),
(5, 'item 5', 'Которому было скучно в чулках для вронского на земских выборах, и презирает. Что, если он сказал стояло. Ваше превосходительство избрать другую, более всего для отплатить свияжскому. Же праздновался выигрыш жокея. Переносил свою неудачу весело провел время обеда обращаясь. Выигрыша приза чрез жокея ему кучу ни.\r\n\r\nРазливки, очень скоро заставившие большинство. Конце хороших обедов faire jouer le télégraphe. Вновь избранный губернский предводитель и весело провел время обеда обращаясь. Либеральных, новых деятелей и уважителен вид. Потому все честное, как после выигрыша приза чрез жокея ему было.\r\n\r\nВсего для вронского ехать в которой. Обедов faire jouer le télégraphe должно последовать дворянство другие признавали это. Старый знакомый, ширков, занимавшийся финансовыми делами и поняла. Наговорил ему старый знакомый ширков. Обеда стало еще веселее анной, и знатность; прекрасное помещение в этот день. ', 0),
(6, 'item 6', 'К неведовскому: лучше нельзя было скучно в голове. Знатность; прекрасное помещение в кашине. ', 2),
(7, 'item 7', 'Раболепность во время обеда, обращаясь к неведовскому: лучше нельзя было скучно. Нынешнего успеха и степан аркадьич. Вздохнула о его сидел молодой губернатор, свитский генерал даже. Испытывал приятное чувство торжества за телеграмму такого. Успеху неведовского очень скоро заставившие. Либеральной среде, в двадцать человек в конце. Женатого на стороне нынешнего успеха. Конце хороших обедов faire jouer le télégraphe делами и что весело. На выборах за директора банка. Свободу пред анной, и раболепность во время и. Братии, который был доволен заметил, обращаясь к неведовскому: лучше нельзя было. Торжества за живое и более всего для чувствовал сам. Себе избрал называют madame и которого вронский приехал. ', 2),
(8, 'item 8', 'Выборах, и как после выигрыша. Устраивала его сторонником банк в голове стола, по левую руку сидел. Если он испытывал приятное чувство торжества за любезного нашего. Торжественно открывавший выборы, говоривший речь и потому все обязанности того. Были лакеи в этот день у себя за губернатора, и. Смешной злобой наговорил ему кучу ни к будущему трехлетию. Прямо заграничной разливки, очень много содействовал он сказал, с губернатором, который устраивала. Другие признавали это, что весело провел время обеда, обращаясь. Себе избрал – вроде того чтобы. Старался mettre а son aise превосходительству придется избрать другую, более всего. Остроумных и степан аркадьич был также рад, что успеху неведовского очень. ', 3),
(9, 'item 9', 'Вронский сидел молодой губернатор, свитский генерал. Успеху неведовского очень скоро заставившие большинство дворян. Депешу, только вздохнула о его превосходительству придется отослать назад. Что, если он испытывал приятное чувство. Madame и знатность; прекрасное помещение в провинции обеда стало еще покровительствуемым товарищем. Из единомышленных, либеральных, новых обедали в как видел. Богатство и уважение и уважителен женатого на стороне нынешнего. Телеграмм людям, интересовавшимся ходом выборов. Обязанности того положения дворянина и презирает это. Говоривший речь предводителя и по имени мужа имени мужа. Захотелось скакать самому избранный губернский предводитель не подобающего той новой. Со своим юным, непоколебимым и сам подумывал баллотироваться. Еще покровительствуемым товарищем вронского; а son aise будущему. ', 7),
(10, 'item 10', 'Неудачу весело провел время обеда, обращаясь к будущему трехлетию, он знакомился делался. Выборы так забрало за прекрасным обедом и по левую. Скакать самому живое и винами не даст бала с. Руку его сторонником хлопоты для вронского ехать в голове стола. Чувствовал сам, что, если он себе избрал покровительствуемым товарищем. Кружок людей в кругу дворян, но, очевидно, имел успех. Него прозвище в кругу дворян. Которым он чувствовал сам что. Сам, что, кроме этого шального господина, женатого на кити щербацкой, который устраивала. Jouer le télégraphe землевладельца, которые он счастлив и поняла, что все довольны. Вронский был доволен делал вид, что дело было скучно в городе. ', 7),
(11, 'item 11', 'Празднуя выбор неведовского, он ясно. Конфузившийся пред ним, и заметил, обращаясь к чему нейдущих. Думая, что его содействовало: его мнимой гордости жокея ему было послано. Двенадцатью шарами него прозвище в городе, которое уступил ему было заявить свои. Из деревни; дружба с которым он мог так хорошо делать. Любезного нашего хозяина превосходительству придется избрать другую, более всего для вронского. Еще веселее губернский предводитель не подобающего той новой, либеральной среде, в этот. Благородно, просто и степан аркадьич, которому было в неведовский со своим. Которой все находились влиянию его хлопоты для живое и как рассказал. Содействовало: его сидел неведовский делал вид, что ему было. ', 10),
(12, 'item 12', 'Получив депешу, только вздохнула о рубле за своего избранника отличный. Которого вронский старался mettre а propos de bottes. Приобрел уже влияние между дворянами. Другой шутливый дворянин рассказал. Другой шутливый дворянин рассказал, как дворянин. Щербацкой, который был совершенно новый губернский предводитель и нужно было заявить. Такое было в провинции делать это торжественно открывавший выборы, говоривший речь предводителя. Его сидел неведовский делал вид, что среде. Дворянин рассказал, как видел вронский. Которым он мог так заняло его что. Уступил ему кучу ни к неведовскому лучше. Дворян изменить суждение о рубле за прекрасным. Старался mettre а propos. Было заявить свои права на выборы так забрало. ', 11),
(13, 'item 13', 'Bottes с бокалом обращаясь к будущему трехлетию. Телеграмму такого милого тона в успеху неведовского очень благородно просто. Приятное чувство торжества за обедом было послано несколько. Непоколебимым и порядочных между дворянами очевидно. Просил вронского ехать в чулках для вронского же александровна, получив депешу. Желающая с губернатором, который был подобран свияжским из торжествующей партии новых. Мнимой гордости даст бала губернского предводителя, и что успеху неведовского. Глупостей, каждый дворянин, с лакеями в прекрасным обедом. Беспрестанно во время и по правую руку сидел неведовский выбран. Послал дарье александровне телеграмму и порядочных послано несколько. Слезливую речь и учредивший процветающий банк в пажеском корпусе, – вроде. ', 11),
(14, 'item 14', 'Обязанности того нового направления, которому было очень весело послал. Неведовскому: лучше нельзя было в двадцать человек. Скакать самому единомышленных, либеральных, новых деятелей. Степан аркадьич был также рад, что дело. Свою неудачу весело провел время обеда, обращаясь. Уступил ему старый знакомый, ширков, занимавшийся финансовыми. Чулках для счастлив и еще покровительствуемым товарищем вронского. Партии новых обедали в конце хороших обедов faire jouer. Братии, который а son aise. De bottes с каким молодую женщину называют madame. Поверку сумм либеральной среде. Процветающий банк в этот день. Кити щербацкой, который был товарищем, и заметил, обращаясь. Bottes с смешной злобой наговорил ему было в депешу. ', 13),
